import React from "react";
import ToggleLink from './links/ToggleLink';
import SectionLink from "../links/Section";

const Navbar = () => {

  return (
    <nav className="navbar">
      <ul>
        <li><SectionLink name="Projects"/></li>
        <li><SectionLink name="Docs" /></li>
        <li><SectionLink name="Blogs" /></li>
        <li><SectionLink name="About" /></li>
        <li><ToggleLink  name="Social"/></li>
      </ul>
    </nav>
  );
}

export default Navbar;
